import axios from 'axios'

axios.defaults.baseURL = process.env.URL_API_BACKEND

export const productApi = {
  async getKFC() {
    const app = await axios.get('/KFC')
    return app
  },

  async getPizzaDay() {
    const app = await axios.get('/PizzaDay')
    return app
  },

  async getIQpizza() {
    const app = await axios.get('/IQPizza')
    return app
  },
}
